var t=Ember.HTMLBars.template({id:"vbunVqq6",block:'{"symbols":[],"statements":[[7,"div",true],[10,"class","docs-md"],[8],[7,"h1",true],[10,"id","what-is-ember-selects-"],[10,"class","docs-md__h1"],[8],[0,"What is ember-selects?"],[9],[0,"\\n    "],[7,"p",true],[8],[7,"code",true],[8],[0,"ember-selects"],[9],[0," was born out of a need to have a limited, focused set of UI components that allow users to select things. "],[9],[0,"\\n"],[7,"p",true],[8],[0,"The HTML "],[7,"code",true],[8],[0,"select"],[9],[0," element doesn\'t get us very far, so most ember developers eventually reach for a more robust solution. It turns out that selects are a suprisingly easy thing for ambitious developers to get wrong (or only half right)."],[9],[0,"\\n"],[7,"p",true],[8],[0,"The existing solutions for select elements in the ember ecosystem are either half-baked, just a wrapper around a jquery library, or give you too much rope to hang yourself with."],[9],[0,"\\n"],[7,"p",true],[8],[7,"code",true],[8],[0,"ember-selects"],[9],[0," aims to remove the guess work from implementing ambitious select UI by giving you a narrow, focused set of excellent out-of-the-box select components that are sufficiently customizable and a breeze to work with."],[9],[0,"\\n"],[7,"p",true],[8],[0,"In pursuit of these design goal, ember-selects makes a few very deliberate API choices that you should be aware of upfront:"],[9],[0,"\\n"],[7,"ul",true],[8],[0,"\\n"],[7,"li",true],[8],[7,"p",true],[8],[7,"strong",true],[8],[0,"Accessible out of the box"],[9],[0," "],[7,"br",true],[8],[9],[0," "],[7,"code",true],[8],[0,"ember-selects"],[9],[0," exposes a set of components that offer out-of-the-box accessibility by implementing established WAI-ARIA patterns, so it works for all your users without you doing a thing."],[9],[0,"\\n"],[9],[0,"\\n"],[7,"li",true],[8],[7,"p",true],[8],[7,"strong",true],[8],[0,"Blackboxed"],[9],[0," "],[7,"br",true],[8],[9],[0," Selects are a very easy thing to get wrong once you leave the safety of HTML\'s built in "],[7,"code",true],[8],[0,"select"],[9],[0," element. "],[7,"code",true],[8],[0,"ember-selects"],[9],[0," offers a set of blackboxed components that are hard to break but a breeze to work with. "],[9],[0,"\\n"],[9],[0,"\\n"],[7,"li",true],[8],[7,"p",true],[8],[7,"strong",true],[8],[0,"Customizable visual design"],[9],[0," "],[7,"br",true],[8],[9],[0," "],[7,"code",true],[8],[0,"ember-selects"],[9],[0," is designed to be designed. It ships with a set of basic styles and gets out of the way so that you can style it to match your app."],[9],[0,"\\n"],[9],[0,"\\n"],[7,"li",true],[8],[7,"p",true],[8],[7,"strong",true],[8],[0,"Implement established ui patterns"],[9],[0," "],[7,"br",true],[8],[9],[0," "],[7,"code",true],[8],[0,"ember-selects"],[9],[0," doesn\'t reinvent the wheel, it implements established UI patterns that are already part of the WAI-ARIA specs - things like "],[7,"code",true],[8],[0,"listbox"],[9],[0,", "],[7,"code",true],[8],[0,"combobox"],[9],[0,", and "],[7,"code",true],[8],[0,"menu"],[9],[0,". You\'ll need to understand these patterns to understand which select component to use for a give use case."],[9],[0,"\\n"],[9],[0,"\\n"],[7,"li",true],[8],[7,"p",true],[8],[7,"strong",true],[8],[0,"Don\'t be everything to everyone"],[9],[0," "],[7,"br",true],[8],[9],[0," "],[7,"code",true],[8],[0,"ember-selects"],[9],[0," is "],[7,"strong",true],[8],[0,"not"],[9],[0," here to give you a maximally configurable, composable or customizable API. In fact, it basically give you no rope to hang your self with at all. Instead, ember-selects offers a limited set of components that each do one thing and do it well. This means that "],[7,"code",true],[8],[0,"ember-selects"],[9],[0," might not meet your need if you have a particularly unique design or UI pattern to implement."],[9],[0,"\\n"],[9],[0,"\\n"],[7,"li",true],[8],[7,"p",true],[8],[7,"strong",true],[8],[0,"Built with ember, for ember"],[9],[0," "],[7,"br",true],[8],[9],[0," "],[7,"code",true],[8],[0,"ember-selects"],[9],[0," is built from the ground up with ember code and ember conventions, so it Just Works with async, promises, ember objects, etc. No external js libraries were involved in the creation of this addon."],[9],[0,"\\n"],[9],[0,"\\n"],[7,"li",true],[8],[7,"p",true],[8],[7,"strong",true],[8],[0,"Built for performance"],[9],[0," "],[7,"br",true],[8],[9],[0," ember-selects offers opt-in tree-shaking, so you only need to ship the components that you are actually using in your app."],[9],[0,"\\n"],[9],[0,"\\n"],[9],[9]],"hasEval":false}',meta:{moduleName:"dummy/templates/docs/index.hbs"}})
